import { Component } from '@angular/core';
import { Router } from '@angular/router';
import { User } from './modules/model/user.model';
import { UserService } from './modules/service/user.service';
import { AdminService } from './modules/service/admin.service';
import { VetService } from './modules/service/vet.service';
import { AdopterService } from './modules/service/adopter.service';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'animalAdoptionFrontend';

  public loggedInUser : User = new User
  public loggedUserJwt = localStorage.getItem('token');
  public userIsAdmin : string = "";
  public userIsVet : string = "";
  public userIsAdopter : string = "";


  constructor(private router: Router, private userService: UserService,
     private adminService : AdminService, private vetService: VetService, private adopterService: AdopterService) {
  }

  ngOnInit(): void {

    this.adminExist()
    this.vetExist()
    this.read()
  }

  logout() {
    localStorage.removeItem('token');
    window.location.href = '/login'

    location.reload()
  }

  read(){
    this.userService.readLoggedInUser().subscribe((response: any) => {
      console.log(JSON.parse(response))

      this.loggedInUser = JSON.parse(response)
    }
   );
  }

  adminExist(){
    this.adminService.adminExists().subscribe((response: any) => {
      console.log(JSON.parse(response))


      localStorage.setItem('userIsAdmin', JSON.parse(response));
      this.userIsAdmin = localStorage.getItem('userIsAdmin')!
      console.log(this.userIsAdmin)
    }
   );
  }

  vetExist(){
    this.vetService.vetExists().subscribe((response: any) => {
      console.log(JSON.parse(response))


      localStorage.setItem('userIsVet', JSON.parse(response));
      this.userIsVet = localStorage.getItem('userIsVet')!
      console.log(this.userIsVet)
    }
   );
  }

  adopterExist(){
    this.adopterService.adopterExists().subscribe((response: any) => {
      console.log(JSON.parse(response))


      localStorage.setItem('userIsAdopter', JSON.parse(response));
      this.userIsAdopter = localStorage.getItem('userIsAdopter')!
      console.log(this.userIsAdopter)
    }
   );
  }
}
<nav class="navbar navbar-expand-lg navbar-dark bg-dark">
  <a class="navbar-brand" routerLink="" style="color:white;">Animal adoption</a>
  <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarColor02" aria-controls="navbarColor02" aria-expanded="false" aria-label="Toggle navigation">
  <span class="navbar-toggler-icon"></span>
  </button>
  <div class="collapse navbar-collapse" id="navbarColor02">
     <ul class="navbar-nav mr-auto" >
      <li class="nav-item active">
         <a *ngIf="loggedUserJwt == null" class="nav-link" routerLink="/register-user">Sign up</a>
      </li>
      <li class="nav-item active">
         <a *ngIf="userIsAdmin === 'true'" class="nav-link" routerLink="/register-animal">New animal</a>
      </li>
      <li class="nav-item active">
         <a *ngIf="userIsAdmin === 'true'" class="nav-link" routerLink="/register-vet">New vet</a>
      </li>
      <li class="nav-item active">
         <a *ngIf="loggedUserJwt !== null" class="nav-link" routerLink="/register-lost-and-found">New lost or found</a>
      </li>
      <li class="nav-item active">
         <a *ngIf="userIsAdmin === 'true'" class="nav-link" routerLink="/approve-lost-and-found-animals">Approve lost or found</a>
      </li>
      <li class="nav-item active">
         <a *ngIf="loggedUserJwt !== null" class="nav-link" routerLink="/lost-animals">Lost</a>
      </li>
      <li class="nav-item active">
         <a *ngIf="loggedUserJwt !== null" class="nav-link" routerLink="/found-animals">Found</a>
      </li>
      <li class="nav-item active">
         <a *ngIf="loggedUserJwt !== null" class="nav-link" routerLink="/unadopted-animals">For adoption</a>
      </li>
      <li class="nav-item active">
         <a *ngIf="loggedUserJwt !== null" class="nav-link" routerLink="/adopted-animals">Adopted animals</a>
      </li>
      <li *ngIf="loggedUserJwt !== null" class="nav-item active">
         <a class="nav-link" routerLink="/subscribed-animals">Subscriptions</a>
      </li>
      <li *ngIf="userIsAdopter === 'true'" class="nav-item active">
         <a class="nav-link" routerLink="/my-adopted-animals-page">My adoptions</a>
      </li>
      <li *ngIf="loggedUserJwt !== null" class="nav-item active">
         <a class="nav-link" routerLink="/user-profile">Profile page</a>
      </li>
      <li *ngIf="loggedUserJwt === null" class="nav-item active">
         <a class="nav-link" routerLink="/login-user">Login</a>
      </li>
      <li *ngIf="loggedUserJwt !== null" class="nav-item active"(click)="logout()">
       <a class="nav-link" routerLink="/login-user">Logout</a>

     </ul>
  </div>
</nav>
